import React from  'react';
import ReactDOM from 'react-dom';

const fname = 'Jiban';
const lname = 'Debashis;'
const now = new Date();
const img1 = './dhaulijk.jpg';


ReactDOM.render(
  <>
  <h1> {`Hello, My name is ${fname} ${lname}`} </h1>
  <p> {`Todat's Date is ${now.getDate() + "/" + now.getMonth() + "/" + now.getFullYear()}`} </p>
  <p> {`Current Time is ${now.getHours() + ":" + now.getMinutes() + ":" + now.getSeconds()} `} </p> 
  <h2 contentEditable="true"> Hello World </h2>
  <img src="./orisa2.jpg" alt="odishaImage" />
  <img src={img1} alt="Dhauli" />
  </>,
  document.getElementById("root"));
